import React, { Component } from "react";
import './CPPUse.css'

class CPPUse extends Component {
  render() {
    return (
      <div className="CPPQuestion">
        <ul className="CPPQuestionLinks">
          <li>
            <a>C</a>
          </li>
          <li>
            <a>C++</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default CPPUse;
